    ShippingServiceCodeType(String v) {
        value = v;
    }
    
    public String value() {
        return value;
    }
    
    public static ShippingServiceCodeType fromValue(String v) {
        if (v != null) {
            for (ShippingServiceCodeType c: ShippingServiceCodeType.values()) {
                if (c.value.equals(v)) {
                    return c;
                }
            }
        }
        throw new IllegalArgumentException(v);
    }
